enum Indicators {
    DotWave = "Dots",
    // Spinner = "Spinner",
    Material = "Material",
    IOS = "iOS",
}

const angleInRadians = (angleInDegrees) => (angleInDegrees - 90) * (Math.PI / 180.0)

const polarToCartesian = (centerX, centerY, radius, angleInDegrees) => {
    const a = angleInRadians(angleInDegrees)
    return {
        x: centerX + radius * Math.cos(a),
        y: centerY + radius * Math.sin(a),
    }
}

const arc = (x, y, radius, startAngle, endAngle) => {
    const fullCircle = endAngle - startAngle === 360
    const start = polarToCartesian(x, y, radius, endAngle - 0.01)
    const end = polarToCartesian(x, y, radius, startAngle)
    const arcFlag = endAngle - startAngle <= 180 ? "0" : "1"

    let d = ["M", start.x, start.y, "A", radius, radius, 0, arcFlag, 0, end.x, end.y].join(" ")

    if (fullCircle) d += "z"
    return d
}

function Spinner({ color }) {
    const length = 360
    const endPercentage = (length / 360) * 100
    const strokeWidth = 10
    const width = 100
    const height = 100

    return (
        <motion.div
            style={{
                height: "85%",
                width: "85%",
                position: "relative",
                originX: 0.5,
                originY: 0.5,
            }}
            animate={{ rotate: 360 }}
            transition={{ loop: Infinity, ease: "linear", duration: 0.5 }}
        >
            <motion.svg
                style={{
                    height: "100%",
                    width: "100%",
                    top: 0,
                    left: 0,
                    right: 0,
                    bottom: 0,

                    position: "absolute",
                    WebkitMask: `conic-gradient(rgba(0, 0, 0, 0.0) 0%, rgba(0, 0, 0,1.0) ${endPercentage}%)`,
                }}
                viewBox="0 0 100 100"
            >
                <g transform="translate(0 0)">
                    <path
                        d={arc(width / 2, height / 2, width / 2 - strokeWidth / 2, 0, length)}
                        fill={"none"}
                        stroke={color}
                        strokeWidth={strokeWidth}
                        strokeLinecap={"round"}
                    />
                </g>
            </motion.svg>
            <motion.svg
                style={{
                    height: "100%",
                    width: "100%",
                    position: "absolute",
                    // border: "1px solid red",
                }}
                viewBox="0 0 100 100"
            >
                <g transform="translate(50 0)">
                    <path d="M 0 0 C 2.761 0 5 2.239 5 5 C 5 7.761 2.761 10 0 10 C 0 10 0 0 0 0 Z" fill={color}></path>
                </g>
            </motion.svg>
        </motion.div>
    )
}
