function DotWave({ color }) {
    const circles = [0, 1, 2]

    return (
        <motion.svg
            style={{
                height: "85%",
                width: "85%",
            }}
            viewBox="0 0 30 30"
            variants={{
                show: {
                    transition: {
                        delayChildren: 0.1,
                        staggerChildren: 0.12,
                    },
                },
            }}
            animate={"show"}
        >
            {circles.map((circle) => (
                <motion.circle
                    style={{ fill: color }}
                    variants={{
                        hidden: { y: 0 },
                        show: { y: [0, 0, 0, -10, 0, 0, 0] },
                    }}
                    key={circle}
                    transition={{
                        yoyo: Infinity,
                        duration: 1.45,
                        ease: "easeInOut",
                    }}
                    r={3}
                    cx={circle * 10 + 5}
                    cy={15}
                />
            ))}
        </motion.svg>
    )
}

function Material({ color }) {
    return (
        <motion.svg
            style={{
                height: "85%",
                width: "85%",
                overflow: "visible",
                originX: "50%",
                originY: "50%",
            }}
            animate={{ rotate: 360 }}
            transition={{ ease: "linear", loop: Infinity, duration: 2 }}
            viewBox="25 25 50 50"
        >
            <motion.circle
                style={{
                    stroke: color,
                    strokeLinecap: "round",
                }}
                animate={{
                    strokeDasharray: ["1, 200", "89, 200", "89, 200"],
                    strokeDashoffset: [0, -35, -124],
                }}
                transition={{
                    duration: 1.5,
                    loop: Infinity,
                    ease: "easeInOut",
                }}
                cx="50"
                cy="50"
                r="20"
                fill="none"
                strokeWidth={2}
                strokeMiterlimit="10"
            />
        </motion.svg>
    )
}

function IOS({ color }) {
    const particles = 12
    const duration = 1
    // this was the death of me
    const arrayRotate = (arr, n) => arr.slice(n, arr.length).concat(arr.slice(0, n))
    const lines = [...new Array(particles)].map((l, i) => (0.9 / particles) * i + 0.1).reverse()
    const lineOpacities = lines.map((l, i) => arrayRotate(lines, i))

    return (
        <motion.svg viewBox="-15 -15 30 30" style={{ width: "100%", height: "100%" }}>
            {lineOpacities.map((lineKeyframes, i) => (
                <motion.g
                    key={i}
                    initial={{ opacity: lineKeyframes[0] }}
                    animate={{ opacity: lineKeyframes }}
                    transition={{
                        duration,
                        loop: Infinity,
                        repeatDelay: 0.0005,
                    }}
                >
                    <rect
                        style={{
                            width: 7,
                            height: 2,
                            fill: color,
                            transform: `rotate(${((particles - i) / particles) * 360 - 90}deg)`,
                        }}
                        x={5}
                        y={-1}
                        rx={1}
                    />
                </motion.g>
            ))}
        </motion.svg>
    )
}

function getIndicator(indicator, props) {
    switch (indicator) {
        case Indicators.DotWave:
            return <DotWave {...props} />
        case Indicators.Material:
            return <Material {...props} />
        case Indicators.IOS:
            return <IOS {...props} />
        // case Indicators.Spinner:
        //     return <Spinner {...props} />
        default:
            return <DotWave {...props} />
    }
}

export function handleTimeout(duration: number, callback: () => void) {
    const id = setTimeout(callback, duration * 1000)
    return () => clearTimeout(id)
}

export function Loading(props) {
    const {
        duration,
        onTimeout,
        fadeOut,
        hasDuration,
        indicator,
        onClick,
        onMouseDown,
        onMouseUp,
        onMouseEnter,
        onMouseLeave,
    } = props

    const controls = useAnimation()
    const animDuration = fadeOut ? Math.min(duration, 0.35) : 0
    const animDelay = fadeOut ? duration - animDuration : duration
    const currentIndicator = getIndicator(indicator, props)
    const handlers = useRef<(() => void)[]>([])

    const onFadeOut = React.useCallback(() => {
        if (hasDuration)
            controls.start({
                opacity: 0,
                transition: { duration: animDuration, ease: "easeIn" },
            })
    }, [hasDuration, animDuration])

    const resetOpacity = async () => {
        controls.set({ opacity: 1 })
    }

    useOnEnter(() => {
        resetOpacity()
        if (hasDuration) handlers.current = [handleTimeout(duration, onTimeout), handleTimeout(animDelay, onFadeOut)]
    })

    // Cancel all timers on exit.
    useOnExit(() => handlers.current.forEach((cleanup) => cleanup))

    // Cancel all timers on unmount.
    useEffect(() => () => handlers.current.forEach((cleanup) => cleanup), [])

    return (
        <motion.div
            {...{ onClick, onMouseDown, onMouseUp, onMouseEnter, onMouseLeave }}
            animate={controls}
            style={{
                position: "relative",
                overflow: "show",
                display: "flex",
                justifyContent: "center",
                alignItems: "center",
                width: "100%",
                height: "100%",
            }}
        >
            {currentIndicator}
        </motion.div>
    )
}

Loading.defaultProps = {
    height: 40,
    width: 40,
    duration: 2,
    hasDuration: false,
}

// Learn more: https://framer.com/api/property-controls/
addPropertyControls(Loading, {
    indicator: {
        title: "Indicator",
        type: ControlType.Enum,
        options: Object.keys(Indicators).map((i) => Indicators[i]),
    },
    color: {
        type: ControlType.Color,
        defaultValue: "#888",
    },
    // transition: { title: "Animation", type: ControlType.Transition },
    hasDuration: {
        title: "Duration",
        type: ControlType.Boolean,
        defaultValue: Loading.defaultProps.hasDuration,
        enabledTitle: "Timeout",
        disabledTitle: "Infinity",
    },
    duration: {
        title: indentTitle("Time"),
        hidden: ({ hasDuration }) => !hasDuration,
        min: 0.1,
        max: 10,
        defaultValue: Loading.defaultProps.duration,
        type: ControlType.Number,
        step: 0.1,
    },
    fadeOut: {
        title: indentTitle("Fade Out"),
        hidden: ({ hasDuration }) => !hasDuration,
        type: ControlType.Boolean,
        enabledTitle: "Yes",
        disabledTitle: "No",
    },
    onTimeout: {
        type: ControlType.EventHandler,
    },
    ...defaultEvents,
})

